class SettingsComponent {
    constructor(authService, router, load, flash) {
        this.authService = authService;
        this.router = router;
        this.load = load;
        this.flash = flash;
        this.address = {
            line1: "",
            line2: "",
            city: "",
            state: "",
            pincode: "",
            type: ""
        };
    }
    ngOnInit() {
        this.load.changeloadStatus(false);
        this.authService.getUserDetails().subscribe((profile) => {
            if (profile) {
                this.load.changeloadStatus(true);
                this.user = profile.user;
                if (this.user.address.length < 1) {
                    this.user.address.push(this.address);
                }
            }
        }, (err) => {
            console.log(err);
            return false;
        });
    }
    onAddAddress() {
        this.user.address.push(this.address);
    }
    onUpdateSubmit() {
        this.authService.editUserDetails(this.user).subscribe((data) => {
            if (data.success) {
                this.authService.updateUserData(data.user);
                this.flash.show(data.msg, { cssClass: 'alert-success', timeout: 10000 });
            }
            else {
                this.flash.show(data.msg, { cssClass: 'alert-danger', timeout: 10000 });
            }
        });
    }
}
